(1, -1, 'Inicio', 213, '1', '1', 1, 0, 1, '', 'frontpage4', 'catalog_frontpage_headline_shop_es|', '<i><b><font color=\"#0E668C\" size=\"16\">¡Bienvenid@ al Catálogo de Habbiz 100% Actualizado</font></b></i><br><br>El HC Club es gratuito, aprovecha la oportunidad de comprar furnis con créditos totalmente gratis de la manera que más te guste. Explora y crea salas geniales para que tu experiencia sea mucho mejor. ¡Navega por nuestra tienda.<br><br><li>Ír a la <a href=\"event:catalog/open/Habbiz_club\"> Tienda HC</a></li><li><a href=\"event:catalog/open/set_pixelnew\"> Decora </a>tus Salas</li><li> Adopta<a href=\"event:catalog/open/Tienda de mascotas\"> una Mascota</a> o un <a href=\"event:catalog/open/bots\">BOT</a></li><li>Crea salas con<a href=\"event:catalog/open/category_wired\"> Wired</a></li><li>Cotiza en el <a href=\"event:catalog/open/marketplace_offers\"> Mercadillo</a></li><br><i><b><font color=\"#0E668C\" size=\"16\">Ã‚Â¿DÃƒÂ³nde puedo obtener Diamantes?</font></b></i><br><br>Tenemos un par de mÃƒÂ©todos de pago como tarjetas de crÃƒÂ©dito y PayPal que le permiten comprar créditos en nuestra tienda web.<br><br><a href=\"https://easybuy.pw/packages/currency\" target=\"_new\">Visita nuestra página de divisas para obtener mÃƒÂ¡s informaciÃƒÂ³n.</a>|CANJEA TU CÓDIGO AQUI:'),
(5, 1004, 'Habbiz Club', 172, '1', '1', 1, 0, 2, 'vip_buy', 'vip_buy', 'clubcat_pic|clubcat_pic|clubcat_pic|clubcat_pic', 'Habbiz Club cuenta con miles de cosas al unirte como, ropa exclusiva, mascotas exclusivas, permisos exclusivos, furnis exclusivos y miles de cosas mas con tu Habbiz Club Ã‚Â¡UNETE!'),
(6, 91, 'Eventos Staffs', 3009, '1', '1', 1, 0, 30, '', 'default_3x3', 'vipheader1|vipteaser2', 'ESTOS RARES que verÃƒÂ¡s a continuaciÃƒÂ³n, son los RARES que darÃƒÂ¡s en Concursos. Ver el CatÃƒÂ¡logo Oficial de HPlux para ver los precios de cada uno. Ã‚Â¡Suerte GM!.'),
(7, 5, 'Habbiz Club', 172, '0', '0', 1, 0, 0, '', 'default_3x3', 'Habbizclub|catalog_hc_teaser', '¡HAZTE HC! O espera.. en Habbiz el HabbizClub es totalmente gratuito, pero como nos sobra bastante crédito, compramos.|'),
(8, 5, 'Regalos HC', 214, '1', '1', 1, 0, 1, '', 'default_3x3', 'catalog_header_hc|hc_catalog_teaser', 'Los Furni mas buscados y solo para miembros Habbiz Club se encuentran aquí­. ¿Los vas a dejar escapar?! Unete al Habbiz Club.|'),
(9, 2007, 'Bots', 65, '1', '1', 1, 0, 2, 'bots', 'bots', 'catalog_bots_headline1_en|catalog_bots_headline1_en', '¡Compra tu Propio Bot, Pueden hablar, caminar y darle estilo a cualquier sala!|Nota: los Bots los puedes personalizar una ves los tenga en tus salas.!'),
(10, 1004, 'Mercadillo', 98, '1', '1', 1, 0, 27, '', 'pets3', 'catalog_marketplace_header_en|catalog_note_marketplace', 'Vende los furnis que no estes ulizando a un precio razonable.|¿No te funciona el mercadillo?|Vendiendo Furnis: Debes vender algun furni que no necesites y que tengas en el inventario y ponerle un precio razonable para su venta.\r\n\r\nComprando Furnis: Simplemente ver el furni cual deseas comprar y revisar si es conveniente o no y comprarlo, fácil y sencillo. ¡RUEBALO!.|'),
(11, 10, 'Mis Ventas', 70, '1', '1', 1, 0, 1, '', 'marketplace_own_items', '', ''),
(12, 10, 'Ofertas', 71, '1', '1', 1, 0, 2, 'marketplace_offers', 'marketplace', '', ''),
(13, 1004, 'Cambio', 69, '1', '1', 1, 0, 26, '', 'default_3x3', 'catalog_bank_headline1|catalog_bank_teaser', 'Convierte tus Créditos en una moneda Especial tradeable. Así, no sólo podrás intercambiar Furni, sino también comprarlos mientras tradeas. Nota: ten en cuenta que una cosa es el valor y otra el precio al que compras cada pieza.|'),
(14, 1007, 'Mascotas', 8, '1', '1', 1, 0, 6, 'pets_shop', 'pets3', 'catalog_pet_headline1|ctlg_pet_note', 'Las mascotas son habitantes de Habbiz Hotel también, así que cada dueño de la mascota tiene que saber un poco acerca de ellos. Si quiere cuidar de su mascota correctamente, asegúrese de leer los siguientes puntos cuidadosamente | Algunas cosas que usted debe saber:. | * Usted puede colocar una mascota en su habitación o tomar uno a dar un paseo con usted en otras habitaciones.\r\n* Usted no puede negociar su mascota sino que usted puede seguir para habitaciones de amigo a recoger los arañazos.\r\n* Usted puede tener hasta 50 mascotas en su habitación, pero cuidar de todos ellos!\r\n*Cuidar de su mascota con comida, agua y golosinas. Compruebe sus accesorios los Animales\'.\r\n*Placas desbloquear y logros por entrenamiento de su mascota.|lamer su mascota y pulsa el botón \"tren\" para obtener una lista de comandos que el nivel de tu mascota en ningún momento!'),
(15, 9020, 'Tapizados', 225, '1', '1', 1, 0, 1, 'set_pixelnew', 'spaces_new', 'catalog_spaces_headline1|', 'Flores, fondos y paisajes - consiguieron una combinaciÃƒÂ³n maravillosa de su habitaciÃƒÂ³n! Utilice nuestra sala de muestra de abajo para probar antes de comprar! Seleccione sus diseÃƒÂ±os y colores favoritos y simplemente haga clic en Comprar! |'),
(16, 1005, 'Rares LTD', 145, '1', '1', 1, 0, 2, '', 'default_3x3', 'limited_header|', 'En Habbiz hay nueva gama de Furnis Rares para todos ustedes, acompañado de 1 mega Rare. Se rápido y compra!, porque son limitados.!|'),
(19, 9021, 'Cine 2013', 136, '1', '1', 1, 0, 20, '', 'default_3x3', 'cinema_catalogheader|movie_catalog_teaser', 'All the way from Habbizwood... Everything you could need and more to create your very own movie magic in a home theatre!|'),
(20, 1004, 'Tienda de Ropa', 74, '1', '1', 1, 0, 6, '', 'default_3x3', 'clothing_catalog_header|tradeableclothing_teaser', 'La ropa y los accesorios transable NUEVO Fusible Couture gama todo es un corte por encima del resto! Desde tops y pantalones vaqueros con estilo, a los accesorios y pelo increíles; Fusible Couture le permite expresarse al extremo!'),
(21, 9049, 'Gnomes', 200, '1', '1', 1, 0, 5, 'xmas14_gnome', 'default_3x3', 'xmas14_catalog_header|xmas14_gnome_teaser', 'The North Pole can be a tough place for a little Gnome, so this year they\'ve migrated to the sunny shores of Fuse Islands. Feed them, train them and treate them with care...'),
(22, 172, 'Nuevo año 2015', 2014, '1', '1', 1, 0, 14, '', 'default_3x3', '2015_header|catalog_2015_header', 'Sólo las cosas que necesita para lanzar un partido impresionante de Año Nuevo 2015!|'),
(24, 9020, 'Ventanas', 218, '1', '1', 1, 0, 21, '', 'default_3x3', 'ctlg_windows_headline1_en|ctlg_windows_teaser1_en', 'Deje un poco de luz en! Nuestras ventanas vienen en muchos estilos para dar un aspecto interesante a su habitaciÃƒÂ³n. Comprar paisajes para ir con las ventanas en la pÃƒÂ¡gina \'Espacios\'! |'),
(25, 92, 'Pruebas', 145, '1', '1', 1, 0, 700, '', 'default_3x3', 'LTDVeranoz|', ''),
(26, 9020, 'Iluminación', 40, '1', '1', 1, 0, 15, '', 'default_3x3', 'catalog_dimmers_header_en|dimmers_teaser', 'Nuestra gama de luces de estado de ánimo le permiten controlar el ambiente y transformar su habitación en tan solo un clic. Cuál será tu habitación parece? Haga clic en el interruptor y averiguar ahora! |'),
(27, 172, 'Navidad', 168, '1', '1', 1, 0, 1, '', 'default_3x3', 'catalog_xmas_headline1|xmas2009_catalogue', 'Conseguirse en el espíritu de la Navidad con nuestra selección de muebles festivo! A partir de las chucherías de reno caca, lo tenemos todo!|'),
(28, 172, 'Navidad Artica', 86, '1', '1', 1, 0, 2, '', 'default_3x3', 'catalog_xmas_headline2_es|xmas2009_catalogue', ''),
(29, 9020, 'Teleportadora', 120, '1', '1', 1, 0, 18, '', 'default_3x3', 'catalog_doors_headline1|catalog_teaser_teleporters', 'Tome su departamento a un nivel completamente nuevo con nuestra gama de teletransportadores era espacial! Acaba de comprar un par, poner uno en cada habitaciÃƒÂ³n y Ã‚Â¡voilÃƒÂ¡! Vas a tener dos habitaciones unidas! |'),
(30, 9020, 'Mode', 39, '1', '1', 1, 0, 11, '', 'default_3x3', 'catalog_mode_headline1|catalog_mode_teaser1', 'Steely, grey, industrial standard metal with a sleek design. The perfect range for a streetwise city dweller.|'),
(32, 9020, 'Pura', 48, '1', '1', 1, 0, 14, '', 'default_3x3', 'puraheader|catalog_pura_teaser1', 'The cleanest, freshest range. You can almost hear it breathe cool and tranquility within your room. Use it to create a haven away from the hectic lifestyle of Fuse Hotel.|'),
(33, 9020, 'Área', 14, '1', '1', 1, 0, 4, '', 'default_3x3', 'catalog_area_headline1|catalog_area_teaser1', 'A chunky and sofisticated line for the down-to-earth, studious Fuse. Its simplicty is beautful and will add a welcoming charm to every room.|'),
(34, 9021, 'Campo', 21, '1', '1', 1, 0, 17, '', 'default_3x3', 'country_header1_en_001|country_teaser1', 'Let\'s leave the busy city streets and head over to the wide abyss of golden wheat, emerald fields and home grown, organic vegetables. Everything you need to create a farm!|'),
(35, 9020, 'Rusticos', 37, '1', '1', 1, 0, 17, '', 'default_3x3', 'catalog_lodge_headline1|catalog_lodge_teaser1', 'For that splendid ski-lodge effect with an open fire and whisky on the sidebar. This range is for those who appreicate the true beauty of solid wood.|'),
(36, 9020, 'Plástico', 46, '1', '1', 1, 0, 13, '', 'default_3x3', 'catalog_plasto_headline1|', 'Throw on an afro and grab a disco ball! Feel that retro, 1970s vibe? You soon will with this colourful, plastic range! Choose a colour to suit your mood and off you go!|'),
(37, 9021, 'Lagomorfo', 192, '1', '1', 1, 0, 126, '', 'default_3x3', 'catalog_header_easter14_001|catalog_lagomorph_teaser', 'From shape shifting wall pieces to crpytic teleports, the isle of Lagomorph furni line is sure to keep you guessing! Nothing is as it seems on this mind-bending island...'),
(38, 9020, 'Baño', 17, '1', '1', 1, 0, 5, '', 'default_3x3', 'catalog_bath_headline1|catalog_bath_teaser1', 'Lets face it.. you can\'t live without your bathroom. Give your guests somewhere to freshen up with our cheeful bathroom collection!|'),
(39, 9020, 'Plantas', 220, '1', '1', 1, 0, 12, '', 'default_3x3', 'catalog_plants_headline1|catalog_plants_teaser1', 'Cada habitación necesita un poco de verdor, querida! No sÃƒÂ³lo mejoran la calidad del aire, que animan una habitación para que sea sencillamente esplándido! Y qué mejor regalo para un amigo que un elegante rosa .. |'),
(40, 9020, 'Alfombras', 116, '1', '1', 1, 0, 3, '', 'default_3x3', 'catalog_rugs_headline1|catalog_rugs_teaser1', 'Alfombras para todas las ocasiones, blanco para las bodas, negro para los funerales y todo lo demÃƒÂ¡s! Todas las alfombras son antideslizante y lavable a mÃƒÂ¡quina. Haga su elecciÃƒÂ³n! |'),
(41, 9020, 'Galeria', 219, '1', '1', 1, 0, 9, '', 'default_3x3', 'catalog_gallery_headline1|catalog_posters_teaser1', 'Adorne sus paredes con carteles, arte, placas y tapices. Esta galerÃƒÂ­a estÃƒÂ¡ llena de artÃƒÂ­culos para todos los gustos, tradicionales y modernos! |'),
