(9220, 1004, 'Novedades 2017', 1466, '1', '0', 1, 0, 3, 'nove_dades', 'default_3x3', '', 'Cada Año Habbiz actualiza la sección Novedades con los nuevos furnis que vayan saliendo del Hotel Oficial HabbizES. En Novedades veréis las nuevas gamas de furni, en este caso del año 2016.|'),
(9221, 9222, 'Ropa', 74, '1', '1', 1, 0, 0, '', 'default_3x3', 'clothing_catalog_header|tradeableclothing_teaser', 'The all NEW Christmas 2015 Fuse Couture tradeable clothing and accessories range is a cut above the rest! From santa outfits to scarfs and hair; Fuse Couture lets you express yourself to the extreme!'),
(9223, 9036, 'Foro del Grupo', 1, '1', '1', 1, 0, 8, '', 'guild_forum', 'group_welcome_info|group_welcome_info|group_welcome_info', '¡Los Foros de Grupo están aquí!|<<i><b><font color=\"#0e3f52\" size=\"16\">¿Qué son los foros de grupo?</font></b></i>\r\n\r\nLos foros le permiten sin esfuerzo publicar, comentar y discutir temas libremente, sin siquiera salir del Hotel!\r\n\r\n<i><b><font color=\"#0e3f52\" size=\"16\">¿Quién puede iniciar un foro? </font></b></i>\r\n\r\nSólo un propietario de grupo puede iniciar un foro para su grupo.\r\n\r\n<i><b><font color=\"#0e3f52\" size=\"16\">¿Necesito una Terminal del Foro?</font></b></i>\r\n\r\nSí - Para iniciar un Foro de Grupo el propietario del grupo debe primero comprar un terminal de foro para el grupo.\r\n\r\n\r\nMás información sobre los foros de grupo <a href=\"event:Habbizpages/forums\">aquí</a>.\r\n\r\nTenga en cuenta que seguiremos añadiendo más funcionalidades a esta función en un futuro próximo.'),
(23123, 172, 'Navidad Dorada', 168, '1', '1', 1, 0, 5, '', 'default_3x3', 'xmas15_head|xmas15_tease', 'saludos de la estación! BRAND NEW antesalas bávara de Navidad ya está disponible!'),
(50675, 9021, 'Battle Ball 2016', 6900, '1', '1', 1, 0, 2, '', 'default_3x3', '', 'Los Furnis BattleBall han llegado a Habbiz. Disfruta de ésta gama de Furnis, decora tu sala, y ¡Diviértete!.|'),
(56070, 9021, 'Jungla 2016', 59, '1', '1', 1, 0, 3, '', 'default_3x3', '', 'Adéntrate en mundo virtual de supervivencia, terreno traicionero y extremas condiciones tropicales... ¡los furnis Habbiz Jungla!'),
(56071, 9021, 'JetSet 2016', 265, '1', '1', 1, 0, 4, '', 'default_3x3', '', 'Vive la vida a tope con nuestra gama de Furnis Jet Set. Es la gama de furnis para aquellos Habbiz\'s. a los que les encanta organizar fiestas de extravagante tamaño y presumir de su estilo.! '),
(56072, 9021, 'Olimpicos 2016', 266, '1', '1', 1, 0, 5, '', 'default_3x3', '', 'Las olimpiadas de este año han empezado y Habbiz no se queda atrás, disfruta de esta nueva gama de furnis para que los Habbizs compitan entre sí­. ¡Suerte!!'),
(56076, 1008, 'Pokemon', 824, '1', '1', 1, 0, 3, '', 'default_3x3', '', ''),
(56077, 1008, 'Rainbow', 40, '1', '1', 1, 0, 4, '', 'default_3x3', '', ''),
(56081, 9220, 'San Valentin 2016', 6901, '0', '1', 1, 0, 1, '', 'default_3x3', 'val15_cata_header|val15_generic_small_promo2', 'El amor está en el aire una vez más! Comprar su novia una rosa o susurrar palabras dulces en su oído en un sofá amor.'),
(56085, 172, 'Habbizween 2016', 267, '1', '1', 1, 0, 11, 'Habbiz_ween16', 'default_3x3', 'catalog_header_hw15|catalog_teaser_hw15', 'Al estilo clásico de Habbizween, los de este año vienen con un diseño similar a los Habbizween de siempre. En donde podrías diseñar una mansión tenebrosa o hasta una casa de vampiros, ¿Tu que crearías?. Por cierto ¡Cuidado!.|'),
(57895, 14, 'Caballos ', 132, '1', '1', 1, 0, 4, '', 'pets', 'catalog_horse_header2_en| ', '||Nombre del Caballo:|Color:'),
(99991, 9220, 'Habbizburger ', 902, '1', '1', 1, 0, 4, '', 'default_3x3', '', 'Bienvenido al Habbizburguer 2016, quieres comer algo, espero que tengas un gran apetito.\r\nEstos furnis llegaron a Habbiz para los usuarios que quieren tener un buen restaurante de 5 estrellas y piensen en grande.'),
