(4, 1, 'Bullying', '¿Bravucón? mejor evita el bullyng, puede que algún dia seas victima de el también.', 0, 0, 0, 0, ''),
(5, 4, 'Información personal', 'No revelar información personal de otro usuario (por ejemplo, dirección, dirección IP, número de teléfono, escuela) sin su consentimiento.', 0, 0, 0, 0, ''),
(6, 7, 'Spamming', 'No repetir excesivamente declaraciones idénticas o similares (spam).', 0, 0, 0, 0, ''),
(7, 4, 'Actos sexuales', 'Actos y conversaciones sexuales en Helandia, deben ser privados así que ten cuidado.', 0, 0, 0, 0, ''),
(8, 5, 'DDoS/Intento de hack', 'No intentes tumbar Helandia, no tiene caso que lo hagas.', 0, 0, 0, 0, ''),
(9, 2, 'Se regala / cuenta de venta / co', 'No intente o regalar, vender o comercio de su cuenta de Helandia y / o Helandia Furnis por artículos virtuales de otro juego, cuentas de otro juego, dinero en efectivo, o viceversa, sin el permiso de un administrador.', 0, 0, 0, 0, ''),
(10, 1, 'Nombres ofensivos ', 'No cree un nombre de usuario con un nombre ofensivo que es insultante, racista, de acoso, o desagradable.', 0, 0, 0, 0, ''),
(11, 2, 'Evadir la prohibición de IP', 'No evadir IPBAN', 0, 0, 0, 0, ''),
(12, 2, 'Compartiendo cuenta', 'No comparta su cuenta con otros usuarios.', 0, 0, 0, 0, ''),
(13, 5, 'Amenazas / Hacks', 'No amenace a, intento, o hackear cuentas de otros usuarios', 0, 0, 0, 0, ''),
(14, 5, 'Multiples cuentas', 'No crear varias cuentas para el propósito de tomar una ventaja.', 0, 0, 0, 0, ''),
(15, 3, 'Abuso de bugs', 'No intente o explotar los errores de Helandia; informar de ello a la Administración de inmediato.', 0, 0, 0, 0, ''),
(16, 3, 'Reembolsos', 'No intente o reembolso de su Membresía VIP o donación a Helandia en un momento dado; todos los pagos son finales.', 0, 0, 0, 0, ''),
(17, 6, 'Misleading Info', 'Do not intentionally give wrong or misleading information to staff members in reports about rule violations, complaints, bug reports, or support requests.', 0, 0, 0, 0, ''),
(18, 3, 'False statements', 'Do not make false statements against Habboon Hotel or any other part of its services.', 0, 0, 0, 0, ''),
(19, 3, 'Impersonation', 'Do not pretend to be a representative of Habboon Hotel or claim to have their powers.', 0, 0, 0, 0, ''),
(20, 6, 'Threatening Habboon', 'Do not threaten to, attempt to, or use any scripts or third party software to enter, disrupt, or modify Habboon Hotel.', 0, 0, 0, 0, '');
